import { observable, action } from 'mobx';
import { v4 as uuidv4 } from 'uuid';

class ToDosStore {
  @action
  getDetails() {
    console.log('getDetails');
  }
}

class TodoStore {
  @observable title = '';
  @observable id = '';
  @observable completed = false;

  constructor(title) {
    this.title = title;
    this.id = uuidv4();
  }
}

export default ToDosStore;
